import React from "react";

import Login from "../views/login";
import CadastroUsuario from "../views/cadastroUsuario"

import { Route, Routes, BrowserRouter } from "react-router-dom";
import Home from "../views/home";
import CadastroConta from "../views/cadastroConta";
import CadastroCartao from "../views/cadastroCartao";
import ConsultaLancamentos from "../views/lancamentos/consultaLancamentos";
import CadastroLancamento from "../views/lancamentos/cadastroLancamento";
import CadastroCategoria from "../views/cadastroCategoria";
import CadastroLimiteDespesa from "../views/CadastroLimiteDespesa";

function Rotas() {
    return (
        <BrowserRouter>
            <Routes>
                <Route path="/" element={<Home />} />
                <Route path="/login" element={<Login />} />
                <Route path="/cadastro-usuario" element={<CadastroUsuario />} />
                <Route path="/cadastro-conta" element={<CadastroConta />} />
                <Route path="/cadastro-cartao" element={<CadastroCartao />} />
                <Route path="/consulta-lancamentos" element={<ConsultaLancamentos />} />
                <Route path="/cadastro-lancamentos" element={<CadastroLancamento />} />
                <Route path="/cadastro-categoria" element={<CadastroCategoria />} />
                <Route path="/cadastro-limite-despesa" element={<CadastroLimiteDespesa />} />
            </Routes>
        </BrowserRouter>
    );
}

export default Rotas;
